import {createRef, useState} from "react";
import {Redirect} from "react-router-dom";
import {changeUrl, changeUrl2} from "../../Redux/reducers/showPageReducer";
import {connect} from "react-redux";
import {ShowImgInRow} from "./ShowImgInRow";

const Show_number = (props) => {

    const [yes,setYes] = useState(false);
    let val = '';
    let val2 = '';
    let ref = createRef();
    let ref2 = createRef();

    const sendInfo = () =>{
        console.log("tap")
        props.changeUrl(val);
        props.changeUrl2(val2);
        ref.current.value ='';
        setYes(true);
    }
    const seeValue = (e) =>{
        val = e.target.value;
    }
    const seeValue2 = (e) =>{
        val2 = e.target.value;
    }
    if(yes) return <Redirect to={"/show"}/>
    let retrievedObject = JSON.parse(localStorage.getItem('testObject'));
    return (
        <div className='Car_app'>
            <input type="text" name='x' placeholder='type a number' ref={ref} onChange={seeValue}/>
            <input type="text" name='x' placeholder='type a last letter (f or s)' ref={ref2} onChange={seeValue2}/>
            <button onClick={()=> sendInfo()}>Check</button>
            <div>Info about Cars</div>
            <div>
                {retrievedObject.map(res => <ShowImgInRow url={res.number}/>)}
            </div>
        </div>
    );
}

let ShowContainer = connect(null,{changeUrl,changeUrl2})(Show_number);
export default ShowContainer;
